import React from 'react'

const About = () => {
  return (
    <div className=''>
      <div className='container'>
        <h1 className="heading text-center"> ABOUT </h1>
        <div className="row mt-5">
          <div className="col-lg-6">
            <p></p>
          </div>
        </div>
      </div>
    </div>
  )
}

export default About;
